def solution(altitude):
    if altitude >= 0:
        if altitude <= 10:
            return "Troposphere"
    if altitude >= 11:
        if altitude <= 50:
            return "Stratosphere"
    if altitude >= 51:
        if altitude <= 85:
            return "Mesosphere"
    if altitude >= 86:
        if altitude <= 1000:
            return "Thermosphere"
    if altitude >= 1001:
        if altitude <= 100000:
            return "Exosphere"
        else:
            return "Space"
        
