def pig_latin(sentence):
    vowels = ['a', 'e', 'i', 'o', 'u']
    words = sentence.split()
    new_sentence = []

    for word in words:
        if word[0].lower() in vowels:
            new_word = word + 'way'
        else:
            new_word = word[1:] + word[0] + 'ay'
        new_sentence.append(new_word)

    return ' '.join(new_sentence)

