def count_tokens(file_name):
    token_count = {}

    with open(file_name, 'r') as file:
        for line in file:
            tokens = line.strip().split()

            for token in tokens:
                if token in token_count:
                    token_count[token] += 1
                else:
                    token_count[token] = 1

    return token_count

def main():
    file_name = input("Enter the name of the file: ")
    token_count = count_tokens(file_name)

    search_token = input("Enter a token to search: ")
    if search_token in token_count:
        print(token_count[search_token])
    else:
        print(0)

if __name__ == "__main__":
    main()

