    num_passed = 0
    
    if (run_test(0, random.randint(1, 5))):
        num_passed += 1
    
    if (run_test(1, random.randint(1, 2))):
        num_passed += 1
    
    if (run_test(2, random.randint(3, 5))):
        num_passed += 1
    
    if (run_test(3, random.randint(3, 5))):
        num_passed += 1
        
    return (100 / 4) * num_passed


# Runs your code in an IDE (for testing purposes)
