def amusement_park_wait_times():
    wait_times = []
    count_over_30 = 0
    shortest_time = float('inf')

    while True:
        wait_time = int(input())
        if wait_time == -999:
            break
        wait_times.append(wait_time)
        if wait_time > 30:
            count_over_30 += 1
        if wait_time < shortest_time:
            shortest_time = wait_time

    print(shortest_time)
    print(count_over_30)

amusement_park_wait_times()

def print_sequence(first, second):
    if second < first:
        print("Second integer can't be less than the first.")
    else:
        i = first
        while i <= second:
            print(i, end=" ")
            i += 10

# Example usage:
print_sequence(-15, 30)
print_sequence(20, 5)
